import React from "react";
import Song from "../data/songs.json";

class SongList extends React.Component {

  render() {
    return (
      <div>
            <tr>
                <td>{this.props.song.artist}</td>
                <td>{this.props.song.title}</td>
            </tr>
      </div>
    );
  }
}

export default SongList;
